import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import './App.css';
import Routes from './routes';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          <li><Link to="/"><button class="but">Home</button></Link></li>
          <li><Link to="/admin"><button class="but">Admin</button></Link></li>
        </header>
        <Routes />
      </div>
    );
  }
}

export default App;
